import { createIcon } from "../icon/createIcon";

export const SuccessTickIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="SuccessTickIcon">
    <path d="M4.489 7.866 2.053 5.421 1 6.457l3.53 3.542L11 2.995l-1.092-.996z" />
  </svg>,
  "SuccessTick",
  "success tick"
);
